import React from 'react'
import Songs from '../Components/SongList/Songs';
import { Title } from '../Components/Styled';
import Layout from './Layout'

function Trends() {
  return (
    <Layout>
      <Title>Trends</Title>
      <div>
        <Songs />
      </div>
    </Layout>
  );
}

export default Trends
